sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
	{ 
	ns:m.0321b4 ns:film.film_character.portrayed_in_films ?y .
	?y ns:film.performance.actor ?x .
	}
	UNION
	{
	ns:m.0321b4 ns:tv.tv_character.appeared_in_tv_program ?y .
	?y ns:tv.regular_tv_appearance.actor ?x .
	}
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  ?x ns:common.topic.alias "W H Smith"@en .
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  ns:m.0cc8tt9 ns:time.recurring_event.instances ?x . # Stanly Cup finals instances

  {
    ?x ns:sports.sports_championship_event.champion ns:m.0j2zj . #(Boston Bruins)
  }
  UNION
  {
    ?x ns:sports.sports_championship_event.runner_up ns:m.0j2zj . #(Boston Bruins)
  }

  ?x ns:time.event.start_date ?st .
}
ORDER BY DESC(xsd:datetime(?st))
LIMIT 1

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  ?x ns:sports.sports_championship_event.championship ns:m.0fjp3 . # World Series
  {
    ?x ns:sports.sports_championship_event.runner_up ns:m.051vz . # Milwaukee Brewers
  }
  UNION
  {
    ?x ns:sports.sports_championship_event.runner_up ns:m.051vz . # Milwaukee Brewers
  }
}
